import React from "react";
// import { Link } from 'react-router-dom'
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

const NavBar = () => (
  <Container padding="0">
    <Columns>
      <Columns.Column>
        <Heading use="h4" paddingY="2rem"> DAVI
        </Heading>
      </Columns.Column>
    </Columns>
  </Container>
);

export default NavBar;
